export default function CityDetails(props) {
  if (!props.similarites) {
    return <div>Loading...</div>;
  }

  const { sameRegion, samePopulace, sameRozloha } = props.similarites;
  
  return (
    <div className="container text-center mb-2">
      <div className="row">
        {/* Kraj */}
        <div className={`col-1 cityData ${sameRegion ? "correct" : "incorrect"}`} id="kraj">
          <span className="align-center breakWord">{props.kraj}</span>
        </div>
        
        {/* Populace*/}
        <div className={`col-1 cityData ${samePopulace}`} id="populace">
          <span className="align-center">{props.populace}</span>
        </div>

        {/* Rozloha */}
        <div className={`col-1 cityData ${sameRozloha}`} id="rozloha">
          <span className="align-center">{props.rozloha}</span>
        </div>
      </div>
    </div>
  );
}
